import jsPDF from "jspdf";
(function (jsPDFAPI) {
  var font =
    "";
  var callAddFont = function () {
    this.addFileToVFS("Quicksand-Bold-normal.ttf", font);
    this.addFont("Quicksand-Bold-normal.ttf", "Quicksand-Bold", "normal");
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
